import React from "react";
import { Route, Switch } from "react-router-dom";
import {AllMeetups, NewMeetup, Favorites, MainNavigation} from './index'

export default function App ()
{
  return (
    <div>
      <h1>My Todo</h1>
      <MainNavigation />
      <Switch>
      <Route path='/' exact>
      <AllMeetups />
      </Route>
      <Route path='/new-meetup'>
      <NewMeetup />
      </Route>
      <Route path='/favorites'>
      <Favorites />
        </Route>
        </Switch>
    </div>
  );
}
